import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import React, {Fragment, useEffect, useState} from 'react';

const NavBar = () => {
    return ( 
<Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="#home">Club Social y Deportivo Moron</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="socios.html">Socios</Nav.Link>
      <Nav.Link >Noticias</Nav.Link>
      <NavDropdown title="Hacete Socio!" id="dropdown-custom-1">
        <NavDropdown.Item >Popular</NavDropdown.Item>
        <NavDropdown.Item >Vitalicio</NavDropdown.Item>
        <NavDropdown.Item >Menor</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Nav>
      <Nav.Link eventKey={2} href="#memes">
        Centro de ayuda
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
    );
}
export default NavBar;
